import React from "react";
import "./login.css";
import HeaderOne from '../header/header.js'

export default function Login(){
    return(
    <div>
        <HeaderOne pagLogin={true} login={false}></HeaderOne>
        <h1>Login</h1>

        <input
            type="email"
            className="email"
            name="email"
            onChange={(v) => setEmail(v.target.value)}
            value={email}/>{" "}
          Associar Colunas
          <br />
        </div>
    )
}
